import React from "react";
import {View, Text} from 'react-native'
import {Auth} from "aws-amplify"

import CustomButton from "../../componets/CustomButton";
import { useNavigation } from "@react-navigation/native";
import CustomTile from "../../componets/CustomTile";


const HomeScreen = () => {
    const navigation = useNavigation();
    const signOut = ()=> {
        Auth.signOut()
    }

    const onCalanderPagePressed = ()=> {
        navigation.navigate('CalanderScreen');
    }

    const onHomePagePressed = ()=> {
        navigation.navigate('UserProfileScreen')
    }
    return (
        <View  style={{flex:1}}>
            <Text style={{fontSize: 24, alignSelf:'center'}}>HOMESCREEN</Text>
            <CustomTile text="Go to calander Page" onPress={onCalanderPagePressed} />
            <CustomTile text="Go to home screen" onPress={onHomePagePressed}/>
            <Text onPress={signOut} style={{
                width:'100%',
                textAlign: 'center',
                color: 'red',
                marginTop: 'auto',
                marginVertical:20,
                fontSize:20,
        }}>Sign Out</Text>
        </View>
    )
}


export default HomeScreen;
